import React, { useState } from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import { Link } from 'react-router-dom';
import { SidebarData } from './SidebarData';
import '../Navbar.css';
import { IconContext } from 'react-icons';

function Navbar() {
  const [sidebar, setSidebar] = useState(false);

  const showSidebar = () => setSidebar(!sidebar);

  return (
    <>
      <IconContext.Provider value={{ color: '#fff' }}>
        <div className='navbar bg-success'>
          <Link to='#' className='menu-bars bg-success d-flex flex-reverse'>
            <FaIcons.FaBars onClick={showSidebar} />
          </Link>
        </div>
        <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
          <ul className='nav-menu-items bg-success' onClick={showSidebar}>
            <li className='navbar-toggle bg-success'>
              <Link to='#' className='menu-bars'>
                <AiIcons.AiOutlineClose />
              </Link>
            </li>
            <li className='list-unstyled'>
              <div className='d-flex flex-column'>
              <Link className='text-decoration-none p-2 font-italic bg-success text-white'>Home</Link>
              <Link className='text-decoration-none p-2 font-italic bg-success text-white'>Recomendation</Link>
              <Link className='text-decoration-none p-2 font-italic bg-success text-white'>Favourites</Link>
              </div>
            </li>

          </ul>
        </nav>
      </IconContext.Provider>
    </>
  );
}

export default Navbar;
